def timeduration(timeseriespath):
    timeserieslist = gt.csv2list_new(csvfilepath=timeseriespath, delimitertype='excel', passmetacol=0, convertype=str)#read timeseries
    result = []
    for item in timeserieslist:        
        if item:
            itemnew = item[1:]
            itemnew.sort()
            duration = numpy.absolute(float(itemnew[-1])-float(itemnew[0]))
            duration_avg = duration/len(itemnew)
            result_one = [item[0].replace('.repost',''),duration,duration_avg]
            result.append(result_one)
    return result

def stat_duration_sucrate(lista,sortindex=2,binlen=1,sum=False):
    lista.sort(cmp=None, key=lambda x:x[sortindex], reverse=False)
    binlen = binlen-1
    s = binlen
    f = binlen
    result = []
    lenlista = len(lista)
    templen = 0
    for item in lista:
        if item[1]=='-1':
            f+=1
        if item[1]=='1':
            s+=1
        if sum:
            if s>templen+binlen or item[0]==lista[-1][0]:
                s = float(s) if s>binlen else 0.1
                result.append([s/(s+f),item[sortindex]])
                templen = s
        else:
            if s>binlen or item[0]==lista[-1][0]:
                s = float(s) if s>binlen else 0.1
                result.append([s/(s+f),item[sortindex]])
                s = binlen
                f = binlen
    return result         
        
